records.addlTxt:
Defendant Camron M Hagen in court with attorney Bridget J. Krause.  James W. Frisch appeared on behalf of Jay R. Pucek for the State of Wisconsin.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.  The Court advised defendant that as a convicted felon not to possess any firearms. Court further advised defendant of voting ineligibility.   

Sentencing proceeded.  Statements by the State, defense and defendant.   The Court imposed the following sentence:

Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years. Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 2 years  with credit for 15 days time served.  Defendant shall serve 2 years on EXTENDED SUPERVISION.    The defendant IS eligible for the Challenge Incarceration Program, but not for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of three (3) years.
 * Court ordered defendant to provide a DNA sample if not previously provided.
 * Court ordered 32 month driver's license revocation and 32 months ignition interlock.
 * Court ordered defendant to complete a driver assessment and safety plan; Order for IDP Related Offense Driver Assessment and Driver Safety Plan, signed and filed; copy provided to defendant.

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - Serve 10 months condition time at the House of Correction, with release to the Day Reporting Center; good time allowed;
 - Undergo a mental health evaluation; follow thru with any treatment regimen recommended;
 - No controlled substances other than those legally prescribed for defendant by a duly licensed physician for his mental or physical needs; taken only as long as deemed medically reasonable and necessary;
 - No alcohol;
 - Urine screens;
 - AODA assessment; treatment if needed;
 - Obtain GED;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Pay a $1,200.00 fine, plus DNA surcharge, costs and surcharges, and supervision fees.  Should defendant get revoked and be sent to prison, Court ordered monies taken from prison funds not to exceed 25%.  Balance to then be paid while on extended supervision.  Failure to pay amounts in full would result in a civil judgment entered against defendant which is non-dischargable in bankruptcy.

